        private IEnumerable<Transform> FindAvatars()
        {
            return currentScene
                .GetRootGameObjects()
                .SelectMany(obj => obj.GetComponentsInChildren<Transform>())
                .Where(transform => transform.gameObject.name == AVATAR_NAME);
